import React from "react";
import MainLogo from "../../UI/MainLogo/MainLogo";

const Footer = () => {

    return(
        <footer className="footer">
            <div className="base_info">
                <MainLogo />
                <span className="company_info"><a href="https://github.com/" className="company_link">Â© 2023 GitHub, Inc.</a></span>
                <span className="develop_info"><a href="https://kpfu.ru/" className="develop_link">Kazan Federal University.</a></span>
            </div>
            <div className="contact_info">
                <span className="fc"><ion-icon name="logo-facebook"></ion-icon></span>
                <span className="vk"><ion-icon name="logo-vk"></ion-icon></span>
                <span className="inst"><ion-icon name="logo-instagram"></ion-icon></span>
                <span className="yt"><ion-icon name="logo-youtube"></ion-icon></span>
                <span className="tw"><ion-icon name="logo-twitter"></ion-icon></span>
                <span className="twich"><ion-icon name="logo-twitch"></ion-icon></span>
            </div>
        </footer>
    )

}

export default Footer;
